import React from "react";
import Quotes from './quotes.json';

const Quote = () => {

    function QuoteReader() {
        Quotes.map( quote => {
            return (
                <div>
                    { quote.quote }
                </div>
            )
        })
    }

    return (
        <h1>
        {QuoteReader}
        </h1>
    );
};

export default Quote;
